import dotenv from "dotenv";


import { Box, Heading, Text, SimpleGrid, Image, VStack, Tabs, TabList, TabPanels, Tab, TabPanel } from "@chakra-ui/react";
import CenteredLayout from "../components/CenteredLayout.jsx";
import SearchPage from "./SearchPage.jsx";
import GoogleCustomSearch from "../components/GoogleCustomSearch.jsx";

const attractions = [
  { name: "Lake Merritt", description: "Heart-shaped lagoon with walking trails.", imageUrl: "data:image/jpeg;base64," },
  { name: "Oakland Museum of California", description: "Art, history, and natural sciences museum.", imageUrl: "https://museumca.org/wp-content/uploads/2022/09/2022_OMCA_LunarNewYear_Entrance_Line_Visitors_Photocredit_ChristineCueto_DSF0560.jpg" },
  { name: "Redwood Regional Park", description: "East Bay park with scenic hiking trails.", imageUrl: "data:image/jpeg;base64," },
];

const restaurants = [
  { name: "Homeroom", description: "Famous for gourmet mac and cheese.", imageUrl: "data:image/jpeg;base64," },
  { name: "Zachary's Chicago Pizza", description: "Beloved deep-dish pizza joint.", imageUrl: "https://zacharys.com/wp-content/uploads/2022/02/Pleasanton-Street.jpg" },
  { name: "Burma Superstar", description: "Popular Burmese restaurant.", imageUrl: "https://assets.simpleviewinc.com/simpleview/image/upload/crm/oakland/Oakland001-1-_2C92FEAD-FD26-4007-A9CEACD95B40D6A9_6d95263f-8bee-48be-8f085f6cd0df419d.jpg" },
];

const hotels = [
  { name: "Kissel Hotel Uptown Oakland on Broadway", description: "", imageUrl: "data:image/jpeg;base64," },
  { name: "Waterfront Hotel", description: "Scenic hotel on Jack London Square.", imageUrl: "https://az760333.vo.msecnd.net/-/media/property/jdv/waterfront/waterfront-exterior-rb0814-crpd1600x760.jpg?ts=d5676eef-435d-4a5c-9a58-ca2dca728603" },
  { name: "Claremont Club & Spa", description: "Luxury hotel with spa services.", imageUrl: "https://www.claremont-hotel.com/content/uploads/2022/10/Claremont-Hotel-Exterior-Sasha-San-Francisco.png" },
];

const ItemCard = ({ name, description, imageUrl }) => (
    <Box borderWidth={1} borderRadius="lg" overflow="hidden">
      <Image src={imageUrl} alt={name} height={200} width="100%" objectFit="cover" />
      <VStack p={4} align="start">
        <Heading size="md">{name}</Heading>
        <Text>{description}</Text>
      </VStack>
    </Box>
);

const AttractionsPage = () => {
  return (
      <CenteredLayout>

        <Box p={8}>
          <centered>

            <Heading mb= {6} textAlign="center">Discover Oakland, CA</Heading>
          </centered>
          <Text mb={8} textAlign="center">Explore the best of Oakland's attractions, restaurants, and hotels.</Text>

          <Tabs isFitted variant="enclosed">
            <TabList mb="1em">
              <Tab>Attractions</Tab>
              <Tab>Restaurants</Tab>
              <Tab>Hotels</Tab>
            </TabList>
            <TabPanels>
              <TabPanel>
                <SimpleGrid columns={{ base: 1, md: 2, lg: 3 }} spacing={10}>
                  {attractions.map((item, index) => (
                      <ItemCard key={index} {...item} />
                  ))}
                </SimpleGrid>
              </TabPanel>
              <TabPanel>
                <SimpleGrid columns={{ base: 1, md: 2, lg: 3 }} spacing={10}>
                  {restaurants.map((item, index) => (
                      <ItemCard key={index} {...item} />
                  ))}
                </SimpleGrid>
              </TabPanel>
              <TabPanel>
                <SimpleGrid columns={{ base: 1, md: 2, lg: 3 }} spacing={10}>
                  {hotels.map((item, index) => (
                      <ItemCard key={index} {...item} />
                  ))}
                </SimpleGrid>
              </TabPanel>
            </TabPanels>
          </Tabs>
        </Box>
      </CenteredLayout>
  );
}

export default AttractionsPage;
